#!/bin/bash
#set -x

############################################################################################
##
## Script to start intuneStatusPage and wait for apps to be installed
##
###########################################

# Define variables
appname="intuneStatusPage"
startCompanyPortalifADE="true"
logdir="/Library/Logs/Microsoft/Intune/Scripts/${appname}"
log="${logdir}/${appname}.log"
metadir="/Library/Intune"
metafile="${metadir}/${appname}.meta"
officeInstallTimeout=200 # change the number of seconds you want to wait for Office to install
appInstallTimeout=200 # change the number of seconds you want to wait for apps to install
intuneStatusPage="${metadir}/${appname}"

# itemsToInstall is an array of apps to install. Add or remove apps as needed
itemsToInstall=("/Applications/CompanyPortal.app")

infoScreen=''

function startLog() {
    ###################################################
    ###################################################
    ##
    ##  start logging - Output to log file and STDOUT
    ##
    ####################
    ####################

    if [[ ! -d "${logdir}" ]]; then
        ## Creating Metadirectory
        echo "$(date) | Creating [${logdir}] to store logs"
        mkdir -p "${logdir}"
    fi

    exec &> >(tee -a "${log}")

    echo ""
    echo "##############################################################"
    echo "$(date) | Logging install of [${appname}] to [${log}]"
    echo "############################################################"
    echo ""
}

function createMetadir() {
    if [[ ! -d "${metadir}" ]]; then
        ## Creating Metadir
        echo "$(date) | Creating [${metadir}] to store logs"
        mkdir -p "${metadir}"
    fi
}

# function to check if softwareupdate is running to prevent us from installing Rosetta at the same time as another script
function isSoftwareUpdateRunning () {
    while ps aux | grep "/usr/sbin/softwareupdate" | grep -v grep; do
        echo "$(date) | [/usr/sbin/softwareupdate] running, waiting..."
        sleep 10
    done
    echo "$(date) | [/usr/sbin/softwareupdate] isn't running, lets carry on"
}

# function to delay until the user has finished setup assistant.
function waitForDesktop() {
  until ps aux | grep /System/Library/CoreServices/Dock.app/Contents/MacOS/Dock | grep -v grep &>/dev/null; do
    echo "$(date) |  + Dock not running, waiting..."
    sleep 1
  done
  echo "$(date) | Dock is here, lets carry on"
}

function preventSleep() {
  echo "$(date) | prevent mac from sleep"
  ## prevent device from sleep
  caffeinate -di &
}

function enableSleep() {
  echo "$(date) | enable sleep"
  killall caffeinate >/dev/null 2>&1
}

function setIntuneStatusPage() {
    echo "$(date) | Set ${appname}"
    echo "$infoScreen" | base64 --decode > "${intuneStatusPage}"
    chmod +x "${intuneStatusPage}"
}

function startIntuneStatusPage() {
  echo "$(date) | Show ${appname}"
  "$intuneStatusPage" 60 &
}

function stopIntuneStatusPage() {
  echo "$(date) | Stop ${appname}"
  killall "$appname" >/dev/null 2>&1
}

function removeIntuneStatusPage() {
    echo "$(date) | Remove ${appname}"
    rm -f "${intuneStatusPage}"
}

function waitForOffice() {
  ready=0
  timeoutCount=$officeInstallTimeout/10
  echo "$(date) | wait for Office"
  while [[ $ready -ne 1 ]];do
    if [[ $timeoutCount -eq 0 ]]; then
      echo "$(date) | Office install timed out"
      ready=1
    elif [[ $(cat /var/log/install.log | grep 'Installed "Microsoft 365 and Office for Mac"') ]]; then
      ready=1
      echo "$(date) | Office installed"
    else
      if [[ $(cat /var/log/install.log | grep 'BusinessPro_Installer') ]]; then
        echo "$(date) | Office is installing"
      fi
      sleep 10
      let "timeoutCount-=1"
    fi
  done
}

function waitForApps() {
  ready=0
  timeoutCount=$appInstallTimeout/10
  echo "$(date) | wait for apps"
  while [[ $ready -ne 1 ]];do
    missingappcount=0

    for i in "${itemsToInstall[@]}"; do
      if [[ -a "$i" ]]; then
        echo "$(date) |  $i is installed"
      else
        echo "$(date) | [$i] application missing"
        let "missingappcount+=1"
      fi
    done
    
    if [[ $timeoutCount -le 0 ]]; then
      echo "$(date) | Apps install timed out"
      ready=1
    elif [[ $missingappcount -eq 0 ]]; then
      ready=1
      echo "$(date) | All apps found"
    else
      echo "$(date) | $missingappcount apps missing"
      echo "$(date) | Waiting for 10 seconds"
      let "timeoutCount-=1"
      sleep 10
    fi
  done
}

###################################################################################
###################################################################################
##
## Begin Script Body
##
#####################################
#####################################

# Initiate logging
startLog
createMetadir

# check if script has already run
if [[ -f "${metafile}" ]]; then
  echo "$(date) | Script has already run, nothing to do"
  exit 0
fi

preventSleep

setIntuneStatusPage

waitForDesktop

startIntuneStatusPage

waitForOffice

waitForApps

echo "$(date) | Writng completion lock to [${metafile}]"
echo "$(date) | executed" >> "${metafile}"

stopIntuneStatusPage

removeIntuneStatusPage

enableSleep